    } finally {
      fn(error, body);
    }
  });
};

module.exports = (res, fn) => {
  res.text = '';
  res.setEncoding('utf8');
  res.on('data', (chunk) => {
    res.text += chunk;
  });
  res.on('end', fn);
};

module.exports = (res, fn) => {
  const data = []; // Binary data needs binary storage

  res.on('data', (chunk) => {
    data.push(chunk);
  });
  res.on('end', () => {
    fn(null, Buffer.concat(data));
  });
};
